import React, { Component } from "react";
import "./CardDisplay.css";
import Card from "./Card";
const CardDisplay = ({ starWarsList }) => {
  return (
    <div className="CardDisplay">
      {starWarsList.results.map((item) => {
        <Card
          name={item.name}
          height={item.height}
          mass={item.mass}
          gender={item.gender}
        />;
      })}
    </div>
  );
};

export default CardDisplay;
